func init() {
	bs, _ := utils.NewEncrypt().Base64DecodeBytes(fontData)
	cap.AddFontFromBytes(bs)
}

func DoLogin(c *gin.Context) {
	username := c.Param("username")
	pwd := c.Param("password")
	captchaStr := c.Param("captcha")
	oriChapchat, _ := c.Cookie("captcha")

	log.Println(captchaStr == oriChapchat)

	if username != config.Conf.UserName && pwd != config.Conf.Password {
		log.Println("user or password unmatch")
		c.JSON(http.StatusOK, utils.Fail(utils.PassErrCode, utils.PassErrMsg, ""))
		return
	}

	// c.JSON：返回JSON格式的数据
	cookie := &http.Cookie{
		Name:     "session_id",
		Value:    "session-886", //这个是value要自己生成？？规则自定就可以？
		Path:     "/",
		HttpOnly: true,
	}
	http.SetCookie(c.Writer, cookie)
	c.JSON(http.StatusOK, utils.SuccWithUrl("/seatinfo/get"))
}

func Login(c *gin.Context) {
	c.HTML(http.StatusOK, "login.html", gin.H{
		"title": "登录",
	})
}

func Captcha(c *gin.Context) {
	cap.SetSize(80, 28)
	cap.SetDisturbance(captcha.DisturLevel(captcha.UPPER))
	cap.SetFrontColor(color.RGBA{255, 255, 255, 255})
	cap.SetBkgColor(color.RGBA{22, 22, 22, 00})

	captchaType := captcha.UPPER
	captchaNumber := 4

	img, str := cap.Create(captchaNumber, captchaType)
	cookie := &http.Cookie{
		Name:     "captcha",
		Value:    strings.ToLower(str), //这个是value要自己生成？？规则自定就可以？
		Path:     "/",
		HttpOnly: true,
	}
	http.SetCookie(c.Writer, cookie)
	png.Encode(c.Writer, img)
}
